// src/components/NavbarPage.jsx
import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import Logo from './Logo.png';

const NavbarPage = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleDropdown = () => {
    setIsOpen(!isOpen);
  };

  return (
    <header className="bg-white shadow-sm w-full">
      <div className="mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex flex-col lg:flex-row justify-between items-center py-4 lg:gap-8">
          <div className="flex justify-between items-center w-full lg:w-auto">
            <Link to="/">
              <img src={Logo} alt="EvenDango" className="block h-10 w-auto" />
            </Link>
            <span className="font-semibold text-lg text-gray-900">
              ven<span className="text-red-600">D</span>ango
            </span>
          </div>
          <button
            onClick={toggleDropdown}
            className="p-2 rounded-md text-gray-400 hover:text-gray-500 focus:outline-none lg:hidden"
          >
            â˜°
          </button>
          <div
            className={`absolute top-full left-0 mt-2 transform ${
              isOpen ? 'block' : 'hidden'
            } bg-white shadow-md p-4 space-y-4 w-full lg:hidden`}
          >
            <Link
              to="/home"
              className="text-gray-700 hover:text-orange-600 font-semibold text-lg block"
            >
              Home
            </Link>
            <Link
              to="/profile"
              className="text-gray-700 hover:text-orange-600 font-semibold text-lg block"
            >
              Profile
            </Link>
            <Link
              to="/about"
              className="text-gray-700 hover:text-orange-600 font-semibold text-lg block"
            >
              About
            </Link>
            <Link
              to="/contact"
              className="text-gray-700 hover:text-orange-600 font-semibold text-lg block"
            >
              Contact
            </Link>
          </div>
        </div>
      </div>
    </header>
  );
};

export default NavbarPage;
